using namespace std;

typedef long long ll;

long long readInt() {
    bool minus1 = false;
    long long result = 0;
    char ch;
    ch = getchar();
    while (true) {
        if (ch == '-') break;
        if (ch >= '0' && ch <= '9') break;
        ch = getchar();
    }
    if (ch == '-') minus1 = true; else result = ch-'0';
    while (true) {
        ch = getchar();
        if (ch < '0' || ch > '9') break;
        result = result*10 + (ch - '0');
    }
    if (minus1)
        return -result;
    else
        return result;
}



vector <ll> P;

map <ll, ll> cnt;

const ll MOD = 2018012016;

void init()  {
	for (int i = 2; i <= 10000; i++) {
        bool ok = true;
        for (int j = 0; j < P.size(); j++) {
            if (P[j] * P[j] >= i) break;
            if (i % P[j] == 0) {
                ok = false;
                break;
            }
        }
        if (ok) {
            P.pb(i);
        }
    }

}

int main() {
	#ifdef IZI_KATKA
	assert(freopen("input", "r", stdin));
    assert(freopen("output", "w", stdout));
    #endif
   	init();
   	int n = readInt();
    for (int i = 1; i <= n; i++) {
        ll x = readInt();
        for (int j = 0; P[j] * P[j] <= x; j++) {
            while (x % P[j] == 0) {
                x /= P[j];
                cnt[P[j]]++;
            }
        }
        if (x > 1) {
            cnt[x]++;
        }
    }
    ll ans = 1;
    ll res = 1;
    for (auto i : cnt) {
        ans *= (((i.S + 1) * (i.S + 2)) / 2) % MOD;
        res *= (i.S + 1);
        ans %= MOD;
        res %= MOD;
    }
    cout << (ans - res + MOD) % MOD;
    return 0;
}